Le cheval-vapeur est une unité de puissance ne faisant pas partie du Système international d'unités, qui exprime une équivalence entre la puissance fournie par un cheval tirant une charge et celle fournie par une machine de propulsion à vapeur. Le cheval était, du fait de son utilisation massive, la référence de puissance des attelages avant l'avènement de la propulsion mécanique. Par exemple, en 1879, les 38 lignes d'omnibus de Paris requéraient l'entretien de 16 500 chevaux. L'abréviation est : 
*  ch pour le cheval-vapeur ; il ne faut pas la confondre avec la notation CV du cheval fiscal ; 
*  hp (horsepower) pour le cheval-vapeur anglais ; 
*  PS (Pferdestärke) pour le cheval-vapeur allemand.
